  render() {
    return (
      <div className="card">
        <h4 className="font-size-14 markdown-heading">
          Style Configuration
        </h4>
        <hr className="hr-style" />
        <StyleConfigFilter style={{margin: "50px"}}/>
        <div style={{display: "flex",justifyContent: "center"}}>
          <div>
             <b>All Styles</b>
             <Table/>
